/*
 * @{
 * Naming for register pointer.
 * gpRealH14EUBB_DVB_COMMON_Bx	   : real register of Common.
 * gpRegH14EUBB_DVB_COMMON_Bx     : shadow register.
 *
 * @def DVB_Common_RdFL: Read  FLushing : Shadow <- Real.
 * @def DVB_Common_WrFL: Write FLushing : Shadow -> Real.
 * @def DVB_Common_Rd  : Read  whole register(UINT8) from Shadow register.
 * @def DVB_Common_Wr  : Write whole register(UINT8) from Shadow register.
 * @def DVB_Common_Rd01 ~ Common_Rdnn: Read  given '01~nn' fields from Shadow register.
 * @def DVB_Common_Wr01 ~ Common_Wrnn: Write given '01~nn' fields to   Shadow register.
 * */
#define DVB_Common_RdFL(_r)																																						\
	do {																																									\
		if (RET_OK != DEMOD_I2C_Read( (DEMOD_DVB_COMM_OFFSET + (UINT32)&(gpRegH14EUBB_DVB_COMMON_Bx->_r) - (UINT32)gpRegH14EUBB_DVB_COMMON_Bx ), 1, (UINT8*)&(gpRegH14EUBB_DVB_COMMON_Bx->_r)) )	\
		{																																									\
			DEMOD_PRINT("[KADP_DVB] FAIL (%s:%d) DEMOD_I2C_Read() !!!\n", __F__, __L__);																		\
			return RET_ERROR;																																				\
		}																																									\
	}while (0)


#define DVB_Common_WrFL(_r)																																							\
	do {																																										\
		if (RET_OK != DEMOD_I2C_Write( (DEMOD_DVB_COMM_OFFSET + (UINT32)&(gpRegH14EUBB_DVB_COMMON_Bx->_r) - (UINT32)gpRegH14EUBB_DVB_COMMON_Bx ), 1, (UINT8*)(& (gpRegH14EUBB_DVB_COMMON_Bx->_r))))	\
		{																																										\
			DEMOD_PRINT("[KADP_DVB] FAIL (%s:%d)  DEMOD_I2C_Write() !!!\n", __F__, __L__);																		\
			return RET_ERROR;																																					\
		}																																										\
	}while (0)


#define DVB_Common_Rd(_r)			*((UINT8*)(&(gpRegH14EUBB_DVB_COMMON_Bx->_r)))
#define DVB_Common_Wr(_r,_v)			((DVB_Common_Rd(_r))=((UINT8)(_v)))

